import React, { useEffect, useState } from 'react';
import axios from 'axios';

const PAGE_SIZE_OPTIONS = [10, 20, 50];

const RecognitionManagement: React.FC = () => {
  const [recognitions, setRecognitions] = useState<any[]>([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  const [page, setPage] = useState(0);
  const [size, setSize] = useState(PAGE_SIZE_OPTIONS[0]);
  const [totalPages, setTotalPages] = useState(1);

  useEffect(() => {
    const fetchRecognitions = async () => {
      setLoading(true);
      setError('');
      try {
        const res = await axios.get(`/recognitions?page=${page}&size=${size}`);
        if (res.data && (res.data.content || res.data.length)) {
          setRecognitions(res.data.content || res.data);
          setTotalPages(res.data.totalPages || 1);
        } else {
          setRecognitions([]);
          setTotalPages(1);
        }
      } catch (err: any) {
        console.error('Recognitions fetch error:', err);
        setError('Failed to fetch recognitions from the backend. Please check if the backend is running and the endpoint is correct.');
        setRecognitions([]);
        setTotalPages(1);
      } finally {
        setLoading(false);
      }
    };
    fetchRecognitions();
  }, [page, size]);

  return (
    <div style={{ width: '100%', overflowX: 'auto' }}>
      <h3 style={{ textAlign: 'center', fontSize: '1rem', fontWeight: 600, marginBottom: 12 }}>Recognitions List</h3>
      {loading && <div style={{ fontSize: '0.7rem' }}>Loading recognitions...</div>}
      {error && <div style={{ color: 'red', fontSize: '0.7rem', marginBottom: 8 }}>{error}</div>}
      <table style={{ width: '100%', fontSize: '0.7rem', background: '#fff', borderRadius: 8, boxShadow: '0 2px 8px #e0e0e0' }}>
        <thead>
          <tr style={{ background: '#8da1bd' }}>
            <th style={{ padding: 8 }}>Category</th>
            <th style={{ padding: 8 }}>Level</th>
            <th style={{ padding: 8 }}>Points</th>
            <th style={{ padding: 8 }}>Sender</th>
            <th style={{ padding: 8 }}>Recipient</th>
            <th style={{ padding: 8 }}>Date</th>
          </tr>
        </thead>
        <tbody>
          {recognitions.map(rec => (
            <tr key={rec.id} style={{ background: '#fff' }}>
              <td style={{ padding: 8 }}>{rec.category}</td>
              <td style={{ padding: 8 }}>{rec.level}</td>
              <td style={{ padding: 8 }}>{rec.awardPoints}</td>
              <td style={{ padding: 8 }}>{rec.senderName || rec.sender || '-'}</td>
              <td style={{ padding: 8 }}>{rec.recipientName || rec.recipient || '-'}</td>
              <td style={{ padding: 8 }}>{rec.sentAt || rec.createdAt || '-'}</td>
            </tr>
          ))}
        </tbody>
      </table>
      {!loading && !error && recognitions.length === 0 && (
        <div style={{ fontSize: '0.7rem', color: '#888', marginTop: 12 }}>No recognitions found.</div>
      )}
      <div style={{ display: 'flex', alignItems: 'center', justifyContent: 'center', marginTop: 16 }}>
        <button style={{ fontSize: '0.7rem', padding: '4px 10px', marginRight: 8 }} disabled={page === 0} onClick={() => setPage(page - 1)}>Prev</button>
        <span style={{ fontSize: '0.7rem', margin: '0 8px' }}>Page {page + 1} of {totalPages}</span>
        <button style={{ fontSize: '0.7rem', padding: '4px 10px', marginLeft: 8 }} disabled={page + 1 >= totalPages} onClick={() => setPage(page + 1)}>Next</button>
        <select style={{ fontSize: '0.7rem', marginLeft: 16 }} value={size} onChange={e => { setSize(Number(e.target.value)); setPage(0); }}>
          {PAGE_SIZE_OPTIONS.map(opt => <option key={opt} value={opt}>{opt} / page</option>)}
        </select>
      </div>
    </div>
  );
};

export default RecognitionManagement;
